import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
  const [message, setMessage] = useState('Testing connection...');
  const [backendStatus, setBackendStatus] = useState('Checking...');

  useEffect(() => {
    // Test if backend is connected
    axios.get('http://localhost:5000/api/auth/test-db')
      .then(response => {
        setMessage('✅ Backend Connected Successfully!');
        setBackendStatus('✅ Connected');
        console.log('Backend response:', response.data);
      })
      .catch(error => {
        setMessage('❌ Backend Connection Failed');
        setBackendStatus('❌ Not Connected');
        console.log('Connection error:', error.message);
      });
  }, []);

  const testRegister = async () => {
    try {
      const response = await axios.post('http://localhost:5000/api/auth/register', {
        name: 'Test User',
        email: 'test@hrms.com',
        password: 'password123',
        role: 'Employee'
      });
      alert('Registration successful! Check browser console for details.');
      console.log('Registration response:', response.data);
    } catch (error) {
      alert('Registration failed. Check browser console for error.');
      console.log('Registration error:', error.response?.data);
    }
  };

  return (
    <div style={{
      minHeight: '100vh',
      background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
      padding: '20px',
      fontFamily: 'Arial, sans-serif',
      color: 'white'
    }}>
      <div style={{
        maxWidth: '800px',
        margin: '0 auto',
        textAlign: 'center'
      }}>
        <h1 style={{ fontSize: '2.5rem', marginBottom: '10px' }}>
          HRMS Lite - Connection Test
        </h1>
        <p style={{ fontSize: '1.2rem', marginBottom: '30px' }}>
          Employee Management System
        </p>

        <div style={{
          background: 'rgba(255, 255, 255, 0.1)',
          padding: '20px',
          borderRadius: '10px',
          marginBottom: '20px'
        }}>
          <h2>Connection Status</h2>
          <p style={{ fontSize: '1.5rem' }}>{message}</p>
        </div>

        <div style={{
          display: 'grid',
          gridTemplateColumns: '1fr 1fr',
          gap: '20px',
          marginBottom: '30px'
        }}>
          <div style={{
            background: 'rgba(255, 255, 255, 0.1)',
            padding: '15px',
            borderRadius: '8px'
          }}>
            <h3>Backend Status</h3>
            <p>{backendStatus}</p>
          </div>
          <div style={{
            background: 'rgba(255, 255, 255, 0.1)',
            padding: '15px',
            borderRadius: '8px'
          }}>
            <h3>Frontend Status</h3>
            <p>✅ Running on Port 3000</p>
          </div>
        </div>

        <button 
          onClick={testRegister}
          style={{
            padding: '15px 30px',
            fontSize: '1.1rem',
            backgroundColor: '#007bff',
            color: 'white',
            border: 'none',
            borderRadius: '8px',
            cursor: 'pointer',
            marginBottom: '20px'
          }}
        >
          Test Registration (Create Test User)
        </button>

        <div style={{
          background: 'rgba(255, 255, 255, 0.1)',
          padding: '20px',
          borderRadius: '10px',
          textAlign: 'left'
        }}>
          <h3>Next Steps:</h3>
          <ol style={{ textAlign: 'left', marginLeft: '20px' }}>
            <li>Click "Test Registration" button above</li>
            <li>Check browser console (F12) for results</li>
            <li>If successful, we'll build the login page</li>
            <li>If failed, we'll fix the error</li>
          </ol>
        </div>

        <div style={{
          marginTop: '30px',
          fontSize: '0.9rem',
          opacity: '0.8'
        }}>
          <p>Backend URL: http://localhost:5000</p>
          <p>Frontend URL: http://localhost:3000</p>
        </div>
      </div>
    </div>
  );
}

export default App;
